import React from "react";

export default function Movie() {
    return(
        <>
            <form className="form">
                <label htmlFor="query" className="label">
                    <input 
                        type="text" 
                        name="query"
                        placeholder="Search for a movie">
                    </input>
                </label>
            </form>
        </>
    )
}
